USE sm;

DROP TABLE IF EXISTS assignment_groups_operators;
DROP TABLE IF EXISTS relations;
DROP TABLE IF EXISTS routineworks;
DROP TABLE IF EXISTS requests;
DROP TABLE IF EXISTS incidents;
DROP TABLE IF EXISTS interactions;
DROP TABLE IF EXISTS knowledges;
DROP TABLE IF EXISTS record_types;
DROP TABLE IF EXISTS devices;
DROP TABLE IF EXISTS assignment_groups;
DROP TABLE IF EXISTS contacts;
DROP TABLE IF EXISTS operators;

#
# TABLE STRUCTURE FOR: operators
#

DROP TABLE IF EXISTS `operators`;

CREATE TABLE `operators` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `login` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'логин для входа в систему',
  `password` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'пароль для входа в систему',
  `userrole` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип учетной записи',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `login` (`login`),
  KEY `operators_login_idx` (`login`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица операторов';



#
# TABLE STRUCTURE FOR: contacts
#

DROP TABLE IF EXISTS `contacts`;

CREATE TABLE `contacts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `firstname` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'имя пользователя',
  `lastname` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'фамилия пользователя',
  `fullname` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'полное имя пользователя',
  `email` varchar(120) COLLATE utf8_unicode_ci NOT NULL COMMENT 'электоронный адрес',
  `position` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'должность',
  `department` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'подразделение',
  `vip` tinyint(1) DEFAULT NULL COMMENT 'приоритетный пользователь',
  `operator_id` int(10) unsigned NOT NULL COMMENT 'логин для входа в систему',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `operator_id` (`operator_id`),
  UNIQUE KEY `unique_fullname` (`fullname`),
  KEY `contacts_fullname_idx` (`fullname`),
  KEY `contacts_email_idx` (`email`),
  CONSTRAINT `contacts_operator_id_fk` FOREIGN KEY (`operator_id`) REFERENCES `operators` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица контактов';



#
# TABLE STRUCTURE FOR: assignment_groups
#

DROP TABLE IF EXISTS `assignment_groups`;

CREATE TABLE `assignment_groups` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'наименование группы',
  `head_id` int(10) unsigned DEFAULT NULL COMMENT 'руководитель группы',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `assignment_groups_name_idx` (`name`),
  KEY `assignment_groups_head_id_fk` (`head_id`),
  CONSTRAINT `assignment_groups_head_id_fk` FOREIGN KEY (`head_id`) REFERENCES `operators` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица рабочих групп';


#
# TABLE STRUCTURE FOR: devices
#

DROP TABLE IF EXISTS `devices`;

CREATE TABLE `devices` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'наименование КЕ',
  `operator_id` int(10) unsigned DEFAULT NULL COMMENT 'владелец КЕ',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `devices_operator_id_fk` (`operator_id`),
  CONSTRAINT `devices_operator_id_fk` FOREIGN KEY (`operator_id`) REFERENCES `operators` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица конфигурационных единиц';



#
# TABLE STRUCTURE FOR: record_types
#

DROP TABLE IF EXISTS `record_types`;

CREATE TABLE `record_types` (
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица типов записей';


#
# TABLE STRUCTURE FOR: knowledges
#

DROP TABLE IF EXISTS `knowledges`;

CREATE TABLE `knowledges` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'наименование документа',
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'подробное описание',
  `author_id` int(10) unsigned DEFAULT NULL COMMENT 'автор документа',
  `type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип записи',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `knowledges_author_id_fk` (`author_id`),
  KEY `knowledges_type_fk` (`type`),
  CONSTRAINT `knowledges_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `knowledges_type_fk` FOREIGN KEY (`type`) REFERENCES `record_types` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица базы знаний';



#
# TABLE STRUCTURE FOR: interactions
#

DROP TABLE IF EXISTS `interactions`;

CREATE TABLE `interactions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `contact_id` int(10) unsigned NOT NULL COMMENT 'инициатор обращения',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'краткое описание',
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'подробное описание',
  `resolution` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'решение',
  `closure_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'код закрытия',
  `device_id` int(10) unsigned DEFAULT NULL COMMENT 'затронутая конфигурационная единица',
  `int_type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип обращения',
  `priority` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'приоритет обращения',
  `status` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'статус обращения',
  `type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип записи',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `interactions_contact_id_fk` (`contact_id`),
  KEY `interactions_device_id_fk` (`device_id`),
  KEY `interactions_type_fk` (`type`),
  CONSTRAINT `interactions_contact_id_fk` FOREIGN KEY (`contact_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `interactions_device_id_fk` FOREIGN KEY (`device_id`) REFERENCES `devices` (`id`),
  CONSTRAINT `interactions_type_fk` FOREIGN KEY (`type`) REFERENCES `record_types` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица обращений';




#
# TABLE STRUCTURE FOR: incidents
#

DROP TABLE IF EXISTS `incidents`;

CREATE TABLE `incidents` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `contact_id` int(10) unsigned DEFAULT NULL COMMENT 'инициатор',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'краткое описание',
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'подробное описание',
  `resolution` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'решение',
  `closure_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'код закрытия',
  `priority` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'приоритет',
  `status` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'статус инцидента',
  `group_id` int(10) unsigned DEFAULT NULL COMMENT 'ответственная группа',
  `assignee_id` int(10) unsigned DEFAULT NULL COMMENT 'ответственный исполнитель',
  `device_id` int(10) unsigned DEFAULT NULL COMMENT 'затронутая конфигурационная единица',
  `type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип записи',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `incidents_contact_id_fk` (`contact_id`),
  KEY `incidents_device_id_fk` (`device_id`),
  KEY `incidents_assignee_id_fk` (`assignee_id`),
  KEY `incidents_group_id_fk` (`group_id`),
  KEY `incidents_type_fk` (`type`),
  CONSTRAINT `incidents_assignee_id_fk` FOREIGN KEY (`assignee_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `incidents_contact_id_fk` FOREIGN KEY (`contact_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `incidents_device_id_fk` FOREIGN KEY (`device_id`) REFERENCES `devices` (`id`),
  CONSTRAINT `incidents_group_id_fk` FOREIGN KEY (`group_id`) REFERENCES `assignment_groups` (`id`),
  CONSTRAINT `incidents_type_fk` FOREIGN KEY (`type`) REFERENCES `record_types` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица инцидентов';



#
# TABLE STRUCTURE FOR: requests
#

DROP TABLE IF EXISTS `requests`;

CREATE TABLE `requests` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `contact_id` int(10) unsigned DEFAULT NULL COMMENT 'инициатор',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'краткое описание',
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'подробное описание',
  `resolution` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'решение',
  `closure_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'код закрытия',
  `priority` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'приоритет',
  `status` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'статус ЗНО',
  `group_id` int(10) unsigned DEFAULT NULL COMMENT 'ответственная группа',
  `assignee_id` int(10) unsigned DEFAULT NULL COMMENT 'ответственный исполнитель',
  `device_id` int(10) unsigned DEFAULT NULL COMMENT 'затронутая конфигурационная единица',
  `type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип записи',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `requests_contact_id_fk` (`contact_id`),
  KEY `requests_device_id_fk` (`device_id`),
  KEY `requests_assignee_id_fk` (`assignee_id`),
  KEY `requests_group_id_fk` (`group_id`),
  KEY `requests_type_fk` (`type`),
  CONSTRAINT `requests_assignee_id_fk` FOREIGN KEY (`assignee_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `requests_contact_id_fk` FOREIGN KEY (`contact_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `requests_device_id_fk` FOREIGN KEY (`device_id`) REFERENCES `devices` (`id`),
  CONSTRAINT `requests_group_id_fk` FOREIGN KEY (`group_id`) REFERENCES `assignment_groups` (`id`),
  CONSTRAINT `requests_type_fk` FOREIGN KEY (`type`) REFERENCES `record_types` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица запросов на обслуживание';



#
# TABLE STRUCTURE FOR: routineworks
#

DROP TABLE IF EXISTS `routineworks`;

CREATE TABLE `routineworks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'наименование работы',
  `status` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'статус регламентной работы',
  `group_id` int(10) unsigned DEFAULT NULL COMMENT 'ответственная группа',
  `assignee_id` int(10) unsigned DEFAULT NULL COMMENT 'ответственный исполнитель',
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'подробное описание',
  `next_date` date DEFAULT NULL COMMENT 'дата следующего запуска',
  `device_id` int(10) unsigned DEFAULT NULL COMMENT 'затронутая конфигурационная единица',
  `type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип записи',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_name` (`name`(10)),
  KEY `routineworks_device_id_fk` (`device_id`),
  KEY `routineworks_assignee_id_fk` (`assignee_id`),
  KEY `routineworks_group_id_fk` (`group_id`),
  KEY `routineworks_type_fk` (`type`),
  CONSTRAINT `routineworks_assignee_id_fk` FOREIGN KEY (`assignee_id`) REFERENCES `operators` (`id`),
  CONSTRAINT `routineworks_device_id_fk` FOREIGN KEY (`device_id`) REFERENCES `devices` (`id`),
  CONSTRAINT `routineworks_group_id_fk` FOREIGN KEY (`group_id`) REFERENCES `assignment_groups` (`id`),
  CONSTRAINT `routineworks_type_fk` FOREIGN KEY (`type`) REFERENCES `record_types` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица регламентных работ';




#
# TABLE STRUCTURE FOR: assignment_groups_operators
#

DROP TABLE IF EXISTS `assignment_groups_operators`;

CREATE TABLE `assignment_groups_operators` (
  `group_id` int(10) unsigned NOT NULL COMMENT 'Группа',
  `operator_id` int(10) unsigned NOT NULL COMMENT 'логин оператора',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`group_id`,`operator_id`),
  KEY `assignment_groups_operators_operator_id_fk` (`operator_id`),
  CONSTRAINT `assignment_groups_operators_group_id_fk` FOREIGN KEY (`group_id`) REFERENCES `assignment_groups` (`id`),
  CONSTRAINT `assignment_groups_operators_operator_id_fk` FOREIGN KEY (`operator_id`) REFERENCES `operators` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица связей';





#
# TABLE STRUCTURE FOR: relations
#

DROP TABLE IF EXISTS `relations`;

CREATE TABLE `relations` (
  `record_1_id` int(10) unsigned NOT NULL,
  `record_1_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `record_2_id` int(10) unsigned NOT NULL,
  `record_2_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`record_1_id`,`record_1_type`,`record_2_id`,`record_2_type`),
  KEY `relations_record_1_type_fk` (`record_1_type`),
  KEY `relations_record_2_type_fk` (`record_2_type`),
  CONSTRAINT `relations_record_1_type_fk` FOREIGN KEY (`record_1_type`) REFERENCES `record_types` (`name`),
  CONSTRAINT `relations_record_2_type_fk` FOREIGN KEY (`record_2_type`) REFERENCES `record_types` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица связей';



